import React from 'react'
import './Navbar.css'

function Navbar  () {
  return (
    <section className='navbar'>
      <ul> 
       <li><a href="/" className="navbar-item">Monitoring</a></li>
       <li><a href="/" className="navbar-item">Product</a></li>
       <li><a href="/" className="navbar-item">User</a></li>
       <li><a href="/" className="navbar-item">Service</a></li>

      </ul> 
    </section>
  )
}
export default Navbar;
